    LANGUAGE plpgsql
    AS $$
BEGIN
    IF EXISTS (SELECT 1 FROM Book_Archive_Link WHERE book_id = OLD.book_id) THEN
        RAISE EXCEPTION 'Cannot delete book: Linked archive exists';
